void block_test()
{

	TN_RV ret = -1, i=0;
	TN_ULONG alg_nid;
	TN_USTRING usIN, usKey, usIv, usEnc, usDec;

	for(i=0; blk_enc_tv[i].AlgID != TN_UNDEFINED; i++)
	{
		memset(&usEnc, 0x00, sizeof(TN_USTRING));
		memset(&usDec, 0x00, sizeof(TN_USTRING));
		
		alg_nid = blk_enc_tv[i].AlgID;
		usIN.length = blk_enc_tv[i].PlainLen; usIN.value = blk_enc_tv[i].Plain;
		usKey.length = blk_enc_tv[i].KeyLen; usKey.value = blk_enc_tv[i].Key;
		usIv.length = blk_enc_tv[i].IVLen; usIv.value = blk_enc_tv[i].IV;	

		printf("\nalg_nid : [%d]\n", alg_nid);
		printf("plain data length : [%d]\n", usIN.length);
		printf("plain data value : ");
		Display(usIN.value, usIN.length);
		
		printf("key data length : [%d]\n", usKey.length);
		printf("key data value : ");
		Display(usKey.value, usKey.length);

		printf("iv data length : [%d]\n", usIv.length);
		printf("iv data value : ");
		Display(usIv.value, usIv.length);

		usEnc.value = NULL;
		ret = TCL_Block_Encrypt(alg_nid, &usIN, &usKey, &usIv, &usEnc);
		if(ret)
		{
			goto err;
		}

		usEnc.value = (unsigned char*)calloc(usEnc.length, sizeof(unsigned char));
		if(!usEnc.value)
		{
			goto err;
		}
		ret = TCL_Block_Encrypt(alg_nid, &usIN, &usKey, &usIv, &usEnc);
		if(!ret)
		{
			printf("enc data length : [%d]\n", usEnc.length);
			printf("enc data value : ");
			Display(usEnc.value, usEnc.length);
			if(memcmp(usEnc.value, blk_enc_tv[i].Cipher, blk_enc_tv[i].CipherLen) != 0)
			{
				printf("TCL_Block_Encrypt KAT Test Failed...\n");
				printf("KAT length : [%d]\n", blk_enc_tv[i].CipherLen);
				printf("KAT value : ");
				Display(blk_enc_tv[i].Cipher, blk_enc_tv[i].CipherLen);
				goto err;
			}
			printf("TCL_Block_Encrypt...success : [%d]\n", TCL_GetErrorCode());
		}

		usDec.value = NULL;
		ret = TCL_Block_Decrypt(alg_nid, &usEnc, &usKey, &usIv, &usDec);
		if(ret)
		{
			goto err;
		}

		usDec.value = (unsigned char*)calloc(usDec.length, sizeof(unsigned char));
		if(!usDec.value)
		{
			goto err;
		}
		ret = TCL_Block_Decrypt(alg_nid, &usEnc, &usKey, &usIv, &usDec);
		if(!ret)
		{
			printf("dec data length : [%d]\n", usDec.length);
			printf("dec data value : ");
			Display(usDec.value, usDec.length);
			if(memcmp(usDec.value, blk_enc_tv[i].Plain, blk_enc_tv[i].PlainLen) != 0)
			{
				printf("TCL_Block_Decrypt KAT Test Failed...\n");
				printf("KAT length : [%d]\n", blk_enc_tv[i].PlainLen);
				printf("KAT value : ");
				Display(blk_enc_tv[i].Plain, blk_enc_tv[i].PlainLen);
				goto err;
			}
			printf("TCL_Block_Decrypt...success : [%d]\n", TCL_GetErrorCode());
		}

		if(usEnc.value != NULL)	{ free(usEnc.value); memset(&usEnc, 0x00, sizeof(TN_USTRING)); }
		if(usDec.value != NULL)	{ free(usDec.value); memset(&usDec, 0x00, sizeof(TN_USTRING)); }
	}

err:
	if(usEnc.value != NULL)	{ free(usEnc.value); memset(&usEnc, 0x00, sizeof(TN_USTRING)); }
	if(usDec.value != NULL)	{ free(usDec.value); memset(&usDec, 0x00, sizeof(TN_USTRING)); }
}

