void hash_test()
{
	TN_RV ret=-1;
	TN_LONG i=0;
	TN_ULONG alg_nid;
	TN_USTRING usIN, usOut;

	for(i=0; msg_dgst_tv[i].AlgID != TN_UNDEFINED; i++)
	{
		memset(&usIN, 0x00, sizeof(TN_USTRING));
		memset(&usOut, 0x00, sizeof(TN_USTRING));

		alg_nid = msg_dgst_tv[i].AlgID;
		usIN.length = msg_dgst_tv[i].MsgLen;
		usIN.value = msg_dgst_tv[i].Msg;

		printf("\nalg_nid : [%d]\n", alg_nid);
		printf("plain data length : [%d]\n", usIN.length);
		printf("plain data value : ");
		Display(usIN.value, usIN.length);

		usOut.value = NULL;
		ret = TCL_Digest(alg_nid, &usIN, &usOut);
		if(ret)
		{
			goto err;
		}

		usOut.value = (TN_BYTE*)calloc(usOut.length, sizeof(TN_BYTE));
		if(!usOut.value)
		{
			goto err;
		}
		ret = TCL_Digest(alg_nid, &usIN, &usOut);
		if(!ret)
		{
			printf("hash data length : [%d]\n", usOut.length);
			printf("hash data value : ");
			Display(usOut.value, usOut.length);

			if(usOut.length != msg_dgst_tv[i].DgstLen)
			{
				printf("TCL_Digest KAT Test Failed...\n");
				printf("KAT length : [%d]\n", msg_dgst_tv[i].DgstLen);
				goto err;
			}

			if(memcmp(usOut.value, msg_dgst_tv[i].Dgst, msg_dgst_tv[i].DgstLen) != 0)
			{
				printf("TCL_Digest KAT Test Failed...\n");
				printf("KAT value : ");
				Display(msg_dgst_tv[i].Dgst, msg_dgst_tv[i].DgstLen);
				goto err;
			}
			printf("TCL_Digest...success : [%d]\n", TCL_GetErrorCode());
		}

		if(usOut.value != NULL)	{ free(usOut.value); memset(&usOut, 0x00, sizeof(TN_USTRING)); }
	}

err:
	if(usOut.value != NULL)	{ free(usOut.value); memset(&usOut, 0x00, sizeof(TN_USTRING)); }
}

void rand_test()
{
	TN_LONG bytes = 32;
	TN_USTRING out;
	TN_RV ret=0;

	memset(&out, 0x00, sizeof(TN_USTRING));

	out.length = bytes;
	out.value = (unsigned char *)calloc(bytes, sizeof(unsigned char));
	
	ret = TCL_GenerateRandom(bytes, &out);
	if(ret == TNR_SUCCESS)
	{
		printf("TCL_GenerateRandom...success : [%d]\n", TCL_GetErrorCode());
		printf("random length : [%d]\n", out.length);
		printf("random value : ");
		Display(out.value, out.length);
	}else
	{
		printf("TCL_GenerateRandom...failed : [%d]\n", ret);
		printf("TCL_GenerateRandom...error code : [%d]\n", TCL_GetErrorCode());
	}

	if(out.value != NULL) free(out.value);
}

/*
	DisplayChar : Display program represent Data to Character String
*/
void DisplayChar(unsigned char *Data,unsigned long Len)
{
	unsigned long j;

	for (j=0; j<Len; j++)
	   printf("%c",Data[j]);

	printf("\n");
}

/*
	Display : Display program represent Data to Hexa Code
*/
void Display(unsigned char *Data,unsigned long Len)
{
	unsigned long j;

	for (j=0; j<Len; j++)
	   printf("%02X",Data[j]);

	printf("\n");
}